import {REGISTER_FORM, UPDATE_TODO_LABEL} from "../types";

export const setRegisterForm = item => {
    return {
        type: REGISTER_FORM,
        payload: item
    }
};

export const setLabelKey = key => {
  return {
      type: UPDATE_TODO_LABEL,
      payload: key
  }
};
